import {
  IonBackButton,
  IonButton,
  IonButtons,
  IonCol,
  IonContent,
  IonFooter,
  IonGrid,
  IonHeader,
  IonImg,
  IonInput,
  IonItem,
  IonLabel,
  IonPage,
  IonRow,
  IonTitle,
  IonToast,
  IonToolbar,
} from "@ionic/react";
import React, { useState } from "react";
import { useHistory } from "react-router";
import TGWLogo from "../../components/TGWLogo.png";
import Connection from "../../mixins/Connection";


var message = '';


const mapResponse = (response: any) => {

};


const SignIn: React.FC = () => {
  const path = useHistory();

  const [showToast, setShowToast] = useState(false);
  const [showLoader, setShowLoader] = useState(false);
  const [showError, setShowError] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");

  const [cellNum, setCellNum] = useState('');
  const [password, setPassword] = useState('');

  const updateCellNum = (cellNum: any) => {setCellNum(cellNum)};
  const updatePassword = (password: any) => {setPassword(password)};

  const buttonHandler = () => {
    let url = "signIn".concat("/", cellNum, "/", password);
    Connection.processGetRequest({}, url, (response: any) => {
      mapResponse(response);
    })
  };

  const mapResponse = (response: any) => {
    if (response.type === "error") {
      setShowLoader(false);
      setErrorMessage(response.data);
      setShowError(true);
    } else {
      setShowLoader(false);
      path.push("/dashboard");
    }
  };

  return (
    <IonPage>
      <IonContent>
          <IonImg src={TGWLogo} alt={"Logo.png"}/>
        <IonToolbar>
          <IonGrid>
            <IonRow>
              <IonCol>
                <IonToolbar>
                  <IonTitle>Sign In</IonTitle>
                </IonToolbar>
              </IonCol>
            </IonRow>
            <IonRow>
              <IonCol>
                <IonItem>
                  <IonLabel position="floating">Cell Number</IonLabel>
                  <IonInput></IonInput>
                </IonItem>
              </IonCol>
            </IonRow>
            <IonRow>
              <IonCol>
                <IonItem>
                  <IonLabel position="floating">Password</IonLabel>
                  <IonInput type="password"></IonInput>
                </IonItem>
              </IonCol>
            </IonRow>
            <IonRow>
              <IonCol>
                <IonButton type="submit" expand="block">
                  SignIn
                </IonButton>
              </IonCol>
            </IonRow>
            <IonRow>
              <IonCol>
                <p>
                  Don't have an account ? <a href="/signUp">Sign Up.</a>
                </p>
              </IonCol>
            </IonRow>
          </IonGrid>
        </IonToolbar>
      </IonContent>
      <IonFooter>
       <IonToast
       isOpen={showToast}
       onDidDismiss={() => setShowToast(false)}
       message={message}
       duration={200}
     />
      </IonFooter>
    </IonPage>
  );
};

export default SignIn;
